// Fibonacci.jsx
import React from 'react';
import '../styles.css';

const Fibonacci = () => {
  return (
    <div className="page multicolor-border p-4 rounded-2xl shadow-lg">
      <h1 className="text-3xl font-bold mb-4">Fibonacci Sequence</h1>
      <p>The Fibonacci sequence is a series of numbers where each number is the sum of the two before it: 0, 1, 1, 2, 3, 5, 8... This pattern appears in nature, from sunflower spirals to pinecones.</p>
      <p>It represents growth and natural harmony. The golden ratio (approximately 1.618) derived from Fibonacci is often used in art, architecture, and even DNA proportions.</p>
      <p>Its recurrence in sacred geometry shows how mathematics reflects the divine structure of the universe.</p>
    </div>
  );
};

export default Fibonacci;
